import React, { Component } from 'react';
import './comment5.css';

class Comment5 extends Component {
  render() {
    const comment5 = this.props.comment5;

    return (
      <div className="commentaire5">
        <p>{comment5}</p>
      </div>
    );
  }
}

export default Comment5;
